"use client";

import React, {useEffect} from "react";
import Image from "next/image";
import { motion, useAnimation, AnimatePresence } from 'framer-motion';
import { useInView } from 'react-intersection-observer';

// Define the FeaturedCategory interface
interface FeaturedCategory {
  name: string;
  imageURL: string;
}

// Animation Variants
const containerVariants = {
    hidden: {},
    visible: {
      transition: {
        staggerChildren: 0.15,
      },
    },
  };

  const cardVariants = {
    hidden: { opacity: 0, y: 30 },
    visible: {
      opacity: 1,
      y: 0,
      transition: { duration: 0.6, ease: 'easeOut' },
    },
    exit: { opacity: 0, y: 30, transition: { duration: 0.4 } },
  };

const FeaturedCategories: React.FC = () => {
    const controls = useAnimation();
  const [ref, inView] = useInView({ triggerOnce: false, threshold: 0.1 });


  const featuredCategories = [
    {
      name: "Shelving and Stands",
      imageURL:
        "data:image/jpeg;base64,",
    },
    {
      name: "Displays & Boards",
      imageURL:
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ7P0vA1HVksNiRx1_H9NjfcinzleHNX_KUaQ&s",
    },
    {
      name: "POS & Electronics",
      imageURL:
        "data:image/jpeg;base64,",
    },
    {
      name: "Baskets & Accessories",
      imageURL:
        "data:image/jpeg;base64,",
    },
    {
      name: "Starter Kits & New Arrivals",
      imageURL:
        "data:image/png;base64,",
    },
  ];

  useEffect(() => {
    if (inView) {
      controls.start('visible');
    } else {
      controls.start('hidden');
    }
  }, [controls, inView]);

  return (
    <div className="bg-white py-16">
      <div className="w-[80%] mx-auto text-center">
        <h2 className="text-2xl md:text-3xl font-semibold mb-4 text-[#1A1D23]">
          Featured Categories
        </h2>
        <p className="text-gray-500 mb-10">
          Find everything you need to bring your shop to life
        </p>

        <motion.div
          ref={ref}
          variants={containerVariants}
          initial="hidden"
          animate={controls}
          className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-5 gap-6"
        >
          <AnimatePresence>
            {featuredCategories.map((category: FeaturedCategory) => (
              <motion.div
                key={category.name}
                variants={cardVariants}
                exit="exit"
                className="flex flex-col items-center p-6 bg-[#F9FAFB] rounded-xl shadow hover:shadow-lg hover:scale-105 transition hover:border hover:border-blue-500 duration-300 cursor-pointer"
              >
                <Image src={category.imageURL} alt="Shelving Icon" width={64} height={64} />
                <h3 className="mt-4 font-medium text-[#1A1D23]">
                  {category.name}
                </h3>
              </motion.div>
            ))}
          </AnimatePresence>
        </motion.div>
      </div>
    </div>
  );
};

export default FeaturedCategories;
